from typing import List
import pytest

class Solution:
    def numSub(self, s: str) -> int:
        MOD = 10 ** 9 + 7
        s += "0"
        c = 0
        ans = 0
        for i in range(len(s)):
            if s[i] == "1":
                c += 1
            else:
                if c != 0:
                    ans = (ans + (c * (c + 1)) // 2 ) % MOD
                    c = 0
        return ans

def test_case_1():
    sol = Solution()
    s = "0110111"
    actual = sol.numSub(s)
    expected = 9
    assert actual == expected

def test_case_2():
    sol = Solution()
    s = "101"
    actual = sol.numSub(s)
    expected = 2
    assert actual == expected

def test_case_3():
    sol = Solution()
    s = "111111"
    actual = sol.numSub(s)
    expected = 21
    assert actual == expected

def test_case_4():
    sol = Solution()
    s = ""
    actual = sol.numSub(s)
    expected = 200542505
    assert actual == expected

if __name__ == '__main__':
    pytest.main()